CREATE TABLE Users(User_Id SERIAL NOT NULL PRIMARY KEY ,Email_Id varchar(50) Not NULL,Password varchar(1000) NOT NULL,First_Name varchar(250) Not NULL,Last_Name varchar(250) NOT NULL,Created_on timestamp without time zone NOT NULL,Created_by varchar not null, Updated_on timestamp without time zone NULL,Updated_by varchar null,Role varchar(20)NOT NULL,Teams Varchar Not NULL,Delete BIT null);
CREATE TABLE Asset(Asset_Id  SERIAL NOT NULL PRIMARY KEY,Asset_Name varchar (50) NOT NULL,Server_Serial varchar NULL,Server_Model varchar NULL,Manufacturer varchar NOT NULL, Owner varchar NULL,Category varchar NULL,Still_needed bool  null,Current_Project varchar null,Notes varchar null,Previous_Project varchar  null,BOM varchar  null,Support_case varchar null,Cluster_Id  Varchar Not NULL,Asset_Location varchar NOT NULL,Lab varchar null, Row int null, Rack int null,RU int  null,DC_status varchar null, Cpu_model varchar(50) NULL,Generation varchar NULL,CPU_Sockets varchar(50) NULL,PDU_IP inet null,PDU_User varchar null,PDU_Password varchar null,BMC_IP inet NOT NULL, BMC_User varchar NOT NULL, BMC_Password varchar NOT NULL, BMC_FQDN varchar NULL,Operating_System varchar null,OS_IP inet null,OS_User varchar  NULL,OS_Password varchar(1000) null,DIMM_Size varchar(50) null ,DIMM_Capacity varchar(50) NULL ,Storage_Vendor Varchar(50)  NULL,Storage_Controller Varchar(50) NULL,Storage_Capacity varchar(50) NULL,Network_Type BOOL  NULL,Network_speed varchar(50) NULL,Number_Of_Network_Ports varchar(50) NULL,Special_Switching_Needs Varchar(100) NULL,Required_Start_Date Date NOT NULL,Required_Finish_Date Date NOT NULL,Created_on timestamp without time zone NOT NULL,Created_by VARCHAR(50)  NULL,Assigned_to INT,FOREIGN KEY(Assigned_to) REFERENCES Users(User_Id) ,Assigned_from timestamp without time zone null,Assigned_by varchar(50)  null,Updated_on timestamp without time zone NULL,Updated_by varchar  NULL, Purpose varchar(300) NULL, Delete BIT NULL,Reserved BOOL NOT NULL);
CREATE TABLE Historic_details(Id SERIAL NOT NULL  PRIMARY KEY,Asset_Id SERIAL NOT NULL ,Asset_Name varchar (50) NOT NULL,Created_on timestamp without time zone NOT NULL,Created_by VARCHAR(50)  NULL,BMC_IP inet NOT NULL,Assigned_to INT,FOREIGN KEY(Assigned_to) REFERENCES Users(User_Id),FOREIGN KEY(Asset_Id) REFERENCES Asset(Asset_Id),Assigned_from timestamp without time zone NOT NULL,Updated_on timestamp without time zone  NULL,Updated_by varchar not null,Remarks varchar(300)NOT NULL,Duration varchar(30) NULL);
CREATE TABLE Server_Request(Id SERIAL NOT NULL PRIMARY KEY,User_No INT NOT NULL,FOREIGN KEY(User_No) REFERENCES Users(User_Id), Requester varchar NOT NULL, Required_Start_Date Date NOT NULL,Required_End_Date Date NOT NULL,Manufacturer varchar(50) NOT NULL,Operating_System varchar(100)NOT NULL,Cpu_model varchar(50)NOT NULL,CPU_Sockets varchar(50) NOT NULL,DIMM_Size varchar(50) not null ,DIMM_Capacity varchar(50)NOT NULL ,Storage_Vendor Varchar(50) NOT NULL,Storage_Controller Varchar(50)NOT NULL,Storage_Capacity varchar(50)NOT NULL,Network_Type BOOL NOT NULL,Network_speed varchar(50)NOT NULL,Number_Of_Network_Ports varchar(50) NOT NULL,Special_Switching_Needs Varchar(100),Chat varchar NULL ,Request bool,Updated_on timestamp without time zone NULL,Updated_by varchar  NULL );



























 
